import React from 'react';
import './student.css';

class Student extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
           <div className='main'>
          <div className='search'><input type='search' placeholder='Search'/></div>
          <form className='form'>
          <label>Name</label>
          <input type='text' required name="name" /><br/><br/><br/>
          <label>Email Id</label>
          <input type='email' required name="email" /><br/><br/><br/>
          <label>Contact Number</label>
          <input type='number' required name='country_code' style={{width:'2%',marginLeft:'15%'}}/>
          <input type='number' required name='contact_no' style={{marginLeft:'0.9%'}}/><br/><br/><br/>
          <label>What Do You Want to Study</label>
          <select style={{marginLeft:'15%'}}>
                    <option name='Btech'>Btech</option>
                    <option name='Medical'>Medical</option>
                    <option name='Law'>Law</option>
                    <option name='Fashion'>Fashion</option>
                </select><br/><br/><br/>
          </form>
          <label>Any Particular Specialization</label>
          <input name='special' style={{marginLeft:'13%'}}/><br/><br/><br/>
          <label>Where Do You want to Study</label>
          <input type='checkbox' name='USA' value='USA' style={{marginLeft:'15%'}}/>USA<br/><br/>
          <input type='checkbox' name='india' value='india' style={{marginLeft:'56%'}}/>INDIA<br/><br/><br/>
          <label>GRE Score(if already appeared)</label>
          <input type='text' required name='gre' style={{marginLeft:'12%'}}/><br/><br/><br/>
           </div>
        )
    }
}
export default Student;
